text17659.addInnerText('<div id=\"text17659\" aria-hidden=\"true\" ><a id=\"text17659anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.336\" style=\"margin-left:0px;text-indent:0px;line-height:1.250;margin-top:0px;margin-bottom:0px;text-align:justify;\" >\n<span class=\"text17659Font1\"  >Matahari merupakan salah satu bintang yang berada di tata surya. Seperti bintang lainnya, matahari adalah bola gas besar yang sebagian besar terdiri dari 75 % hidrogen , 7,8% helium dan sisanya terdiri dari nitrogen, karbon, dan oksigen. Sinar matahari adalah energi pancaran dari matahari.</span ><span class=\"text17659Font2\" style=\"background-color:transparent\" >\n</span ></p >\n</div>\n');
text17659.build()

text17716.addInnerText('<div id=\"text17716\" aria-hidden=\"true\" ><a id=\"text17716anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.336\" style=\"margin-left:0px;text-indent:0px;line-height:1.250;margin-top:0px;margin-bottom:11px;text-align:justify;\" >\n<span class=\"text17716Font2\"  >Matahari menghasilkan energi di intinya dalam proses yang disebut fusi nuklir, yaitu penggabungan inti dari gas-gas hidrogen membentuk gas helium. Selama fusi nuklir, tekanan dan suhu panas matahari yang sangat tinggi, yang menyebabkan atom hidrogen berpisah dan inti atom melebur atau bergabung. Empat inti hidrogen berfusi menjadi satu atom helium. Tetapi atom helium memiliki berat kurang dari empat inti yang digabungkan untuk membentuknya. Proses penggabungan ini akan menimbulkan hasil berupa energi panas, cahaya, dangelombang yang sangat besar. Beberapa materi hilang selama fusi nuklir. \n</span ></p >\n</div>\n');
